class Utility {
     
    static create_UUID(){
        let dt = new Date().getTime();
        let uuid = 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
            let r = (dt + Math.random()*16)%16 | 0;
            dt = Math.floor(dt/16);
            return (c ==='x' ? r :(r&0x3|0x8)).toString(16);
        });
        return uuid;
    } 
     
    static getURLParameterByName = function (URL, name) {
        name = name.replace(/[\[]/, "\\[").replace(/[\]]/, "\\]");
        var regex = new RegExp("[\\?&]" + name + "=([^&#]*)",'i'),
            results = regex.exec(URL);
        return results === null ? "" : decodeURIComponent(results[1].replace(/\+/g, " "));
    }

    static deepCopy(obj) {
        if(typeof obj !== 'object' || obj === null) {
            return obj;
        }
      
        if(obj instanceof Array) {
            return obj.reduce((arr, item, i) => {
                arr[i] = this.deepCopy(item);
                return arr;
            }, []);
        }
    
        if(obj instanceof Object) {
            return Object.keys(obj).reduce((newObj, key) => {
                newObj[key] = this.deepCopy(obj[key]);
                return newObj;
            }, {})
        }
    }
	
	static getURLObject(URL){
		let index = -1;
		DB.forEach((element,_index) => {
			if(element.url.toLowerCase() === URL.toLowerCase())
				index = _index;
		});
		
		if(index>-1)
			return DB[index];
			
		return null;
    }
    
    static sleep(milliseconds) {
    }

    static sleep_PS(milliseconds) {
        return new Promise(resolve => setTimeout(resolve, milliseconds));
    }
}

class EventDispatcher {
  constructor(){
      this._listeners = {};
  }

  addEventListener(type, listener ){

    if ( this._listeners === undefined ) this._listeners = {};

    let listeners = this._listeners;

    if ( listeners[ type ] === undefined ) {
    listeners[ type ] = [];
  }

  if ( listeners[ type ].indexOf( listener ) === - 1 ) {
    listeners[ type ].push( listener );
  }
  }

  hasEventListener( type, listener  )  {

  if ( this._listeners === undefined ) return false;

  let listeners = this._listeners;

  return listeners[ type ] !== undefined && listeners[ type ].indexOf( listener ) !== - 1;

  }

  removeEventListener( type, listener  ){

  if ( this._listeners === undefined ) return;

  var listeners = this._listeners;
  var listenerArray = listeners[ type ];

  if ( listenerArray !== undefined ) {
    var index = listenerArray.indexOf( listener );
    if ( index !== - 1 ) {
      listenerArray.splice( index, 1 );
    }
  }
  }

  removeAllEventListener() {
    this._listeners = undefined;
  }

  dispatchEvent(event) {
    if (this._listeners === undefined) return
    let listeners = this._listeners;
    let listenerArray = listeners[event.type];
    if (listenerArray !== undefined) {
      event.target = this;
      let array = [];
      let length = listenerArray.length;
      for (let i = 0; i < length; i++) {
        array[i] = listenerArray[i];
      }
      for (let i = 0; i < length; i++) {
        array[i].call(this, event);
      }
    }
  }
}

